import styled from "styled-components";

export const Back = styled.h1`
  height: 100vh;
  width: 100vw;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 148;
  font-family: "Oswald", sans-serif;
  font-weight: bold;
  color: #096192;
`;
